※製品はフロントグリルの下に装着されている白いFRPパーツを指します。<table border="0" cellpadding="0" cellspacing="0" width="410">
<tr>
<td align="reft">

<font size="3">
<font color="#333333">※大型商品のため全国一律送料1,620円（税込）が別途かかります。</font><br><br>

スズキジムニー JB23用（FRP製 黒ゲルコート）
<br><br>
ジムニーのフロント部の顔つきのイメージアップにはどうしても純正バンパーの取り外しが必要。またしし狩りバンパーや角バンパーなどの製品をつけるためにも取り外さなければなりません。しかし外すとグリルの下及びライト周辺部の形状がまとまらず未完成な感じになってしまいます。それをうまく絶妙にカバーしながら純正よりも精悍なルックスに仕上げるための必需品がこのフロントバンパーフガーニッシュです。<br><br>
製品はFRP製品で黒ゲルコート仕上げ。写真のデモカーは純正色に塗装されています。塗装はお近くの板金塗装専門店等へのご依頼をしてください製品に塗装代は含まれていません。<br><br>
製品はFRP製品の手作り品につき大量生産できません。在庫切れの場合、納期がご注文後約1週間～1ヶ月程度かかる場合がございます。あらかじめご了承下さい。他のアピオ製品と同時にご注文いただく場合は先にこの製品代を含む金額をお支払いいただき製品が完成後、通常の宅配便でお届けします。<br><br>

材質：FRP製<br>
塗装：未塗装（黒ゲルコート仕上げ）<br>
取付：ボルトオン装着<br>
車検適合品<br><br>

この商品を取り付けた場合フェンダーライナーのカットが必要です。<br>
＜説明＞フロントのタイヤハウスの中は黒い樹脂製のカバーで覆われているのですが、純正フロントバンパーを取り外すとこの樹脂カバーが長く垂れ下がってしまいます。そこでこれをフロントバンパーガーニッシュの長さに合わせてカットす必要があります。カットは大きめのカッター等で可能です。
</font>



